async function getAWSCredentials(domain_name, access_key, secret_key){
    var domain_name = "domain_name="+domain_name;
    var access_key = "access_key="+await kaholo.vault.getValueByKey(access_key);
    var secret_key = "secret_key="+await kaholo.vault.getValueByKey(secret_key);
    return domain_name + "\n" + access_key + "\n" + secret_key;
